import { useParams } from 'react-router-dom';

export function Services() {
  const { id } = useParams();
    return (
        <div style={{ padding: '2rem', color: '#fff' }}>
        <h1>Services</h1>
        <p>Voici la liste de mes services :</p>
        <ul>
          <li>Développement web</li>
          <li>Design UI/UX</li>
          <li>Consultation en stratégie digitale</li>
          <li>Formation</li>
          </ul>
          </div>
    );
  }
